/* Some basic time value -> component conversion tests */

print('basic conversion tests');

// Not called during normal execution, used manually to generate random tests.
// Run with nodejs.
function generateRandomTests(n) {
    var i, tv, d, obj, res;

    function enc(x) {
        if (isNaN(x)) {
            return 'NaN';
        }
        return String(x);
    }

    res = [];
    for (i = 0; i < n; i++) {
        // Random day number from a range which covers and goes slightly over
        // the E5 valid range (we want NaN results too).
        tv = (Math.random() * (220e6) - 110e6) * (24 * 60 * 60 * 1000);

        d = new Date(tv);
        obj = {
                  tval: tv,
                  fullYear: d.getUTCFullYear(),
                  month: d.getUTCMonth(),
                  date: d.getUTCDate(),
                  hours: d.getUTCHours(),
                  minutes: d.getUTCMinutes(),
                  seconds: d.getUTCSeconds(),
                  milliseconds: d.getUTCMilliseconds(),
                  day: d.getUTCDay()
              };

        res.push('    ' +
                 [ enc(tv), enc(obj.fullYear), enc(obj.month), enc(obj.date), enc(obj.hours),
                   enc(obj.minutes), enc(obj.seconds), enc(obj.milliseconds), enc(obj.day) ].join(', ') +
                 ',');
    }

    // This is intended, don't remove/convert to print.
    console.log(res.join('\n'));
}

function testConv(x) {
    var d = new Date(x.tval);
    var t1 = [
                x.fullYear,
                x.month,
                x.date,
                x.hours,
                x.minutes,
                x.seconds,
                x.milliseconds,
                x.day
             ].join(' ');
    var t2 = [
                d.getUTCFullYear(),
                d.getUTCMonth(),
                d.getUTCDate(),
                d.getUTCHours(),
                d.getUTCMinutes(),
                d.getUTCSeconds(),
                d.getUTCMilliseconds(),
                d.getUTCDay()
             ].join(' ');
    print(t1, t2);
}

